public static <T> T throwAsParseException(XMLStreamException e, JsonParser p) throws IOException {
    Throwable t = _unwrap(e);
    throw new JsonParseException(p, _message(t, e), t);
}

public static <T> T throwAsGenerationException(XMLStreamException e, JsonGenerator g) throws IOException {
    Throwable t = _unwrap(e);
    throw new JsonGenerationException(_message(t, e), t, g);
}

private static Throwable _unwrap(Throwable t) {
    while (t.getCause() != null) {
        t = t.getCause();
    }
    if (t instanceof Error)
        throw (Error) t;
    if (t instanceof RuntimeException)
        throw (RuntimeException) t;
    return t;
}

private static String _message(Throwable t1, Throwable t2) {
    String msg = t1.getMessage();
    if (msg == null) {
        msg = t2.getMessage();
    }
    return msg;
}

public static String sanitizeXmlTypeName(String name) {
    // [dataformat-xml#451]: with DEDUCTION, at least, won't have property name
    //   (but probably sensible to check for it anyway)
    if (name == null) {
        return null;
    }
    StringBuilder sb;
    int changes = 0;
    // First things first: remove array types' trailing[]...
    if (name.endsWith("[]")) {
        do {
            name = name.substring(0, name.length() - 2);
            ++changes;
        } while (name.endsWith("[]"));
        sb = new StringBuilder(name);
        // do trivial pluralization attempt
        if (name.endsWith("s")) {
            sb.append("es");
        } else {
            sb.append('s');
        }
    } else {
        sb = new StringBuilder(name);
    }
    for (int i = 0, len = name.length(); i < len; ++i) {
        char c = name.charAt(i);
        if (c > 127)
            continue;
        if (c >= 'a' && c <= 'z')
            continue;
        if (c >= 'A' && c <= 'Z')
            continue;
        if (c >= '0' && c <= '9')
            continue;
        if (c == '_' || c == '.' || c == '-')
            continue;
        // Ok, need to replace
        ++changes;
        if (c == '$') {
            sb.setCharAt(i, '.');
        } else {
            sb.setCharAt(i, '_');
        }
    }
    if (changes == 0) {
        return name;
    }
    return sb.toString();
}

