public static String findNamespaceAnnotation(MapperConfig<?> config, AnnotationIntrospector ai, AnnotatedMember prop) {
    for (AnnotationIntrospector intr : ai.allIntrospectors()) {
        if (intr instanceof AnnotationIntrospector.XmlExtensions) {
            String ns = ((AnnotationIntrospector.XmlExtensions) intr).findNamespace(config, prop);
            if (ns != null) {
                return ns;
            }
        }
    }
    return null;
}

